To create a web application using React, Node.js, and Express.js, you can follow these steps:

1. Set up the project structure:

Create a new directory for your project and navigate into it:
```
mkdir my-app
cd my-app
```
Initialize a new Node.js project and install the necessary dependencies:
```
npm init -y
npm install express cors body-parser nodemon
npm install --save-dev concurrently
```
Create a new React app using Create React App:
```
npx create-react-app client
```
2. Set up the server:

Create a new file called `server.js` in the root directory of your project and add the following code:
```javascript
const express = require('express');
const cors = require('cors');
const bodyParser = require('body-parser');

const app = express();

app.use(cors());
app.use(bodyParser.json());

// Add your routes here

const PORT = process.env.PORT || 5000;

app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
```
3. Set up the client:

Navigate to the `client` directory and install Axios to make HTTP requests from the client:
```
cd client
npm install axios
```
4. Create dummy data:

You can create dummy data by adding it to the server or by using a mock API service like JSONPlaceholder.

For example, you can add the following code to `server.js` to create a dummy endpoint:
```javascript
app.get('/api/data', (req, res) => {
  const data = [
    { id: 1, name: 'Item 1' },
    { id: 2, name: 'Item 2' },
    { id: 3, name: 'Item 3' },
  ];

  res.json(data);
});
```
5. Fetch data from the server:

In the `client` directory, create a new file called `App.js` and add the following code:
```javascript
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios('/api/data');
      setData(result.data);
    };

    fetchData();
  }, []);

  return (
    <div>
      {data.map((item) => (
        <div key={item.id}>
          <h2>{item.name}</h2>
        </div>
      ))}
    </div>
  );
}

export default App;
```
6. Deploy the code:

To deploy the code, you can use a service like Heroku or Netlify.

First, you need to create a production build of the React app:
```
cd client
npm run build
```
This will create a `build` directory in the `client` directory.

Next, you need to update the `server.js` file to serve the static files from the `build` directory:
```javascript
const path = require('path');

// ...

app.use(express.static(path.join(__dirname, 'client/build')));

app.get('*', (req, res) => {
  res.sendFile(path.join(__dirname+'/client/build/index.html'));
});
```
Finally, you can deploy the code to Heroku by following these steps:

* Create a new Heroku app
* Install the Heroku CLI
* Log in to Heroku using the CLI
* Add a new remote to the Heroku app
* Push

JavaScript's built-in sorting function is case-insensitive by default. However, you can create a custom sorting function to make it case-sensitive. Here's an example:

```javascript
let arr = ['Apple', 'banana', 'Cherry', 'avocado'];

arr.sort((a, b) => {
  if (a.toLowerCase() < b.toLowerCase()) return -1;
  if (a.toLowerCase() > b.toLowerCase()) return 1;
  return 0;
});

console.log(arr); // ['Apple', 'avocado', 'banana', 'Cherry']
```

In this example, the sorting function compares the lowercase versions of the strings to ensure that the sorting is case-insensitive. However, the original strings are returned in the sorted array, preserving their original case.

If you want a case-sensitive sort, you can simply remove the `toLowerCase()` method:

```javascript
let arr = ['Apple', 'banana', 'Cherry', 'avocado'];

arr.sort((a, b) => {
  if (a < b) return -1;
  if (a > b) return 1;
  return 0;
});

console.log(arr); // ['Apple', 'Cherry', 'avocado', 'banana']
```

